import HomePage from "./pages/HomePage";
import CategoryList from "./components/CategoryList";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
